  - name: TEXT4000
    number: '4'
    value: We are in receipt of your letter regarding our May 2002 monthly report
      pertaining to United Seniors PAC's 'best efforts' to obtain information on each
      contributor according to FEC requirements.  United Seniors PAC requests employer
      and occupation information from each potential contributor in all of its fundraising
      appeals.  We then make an additional attempt to obtain the information within
      two weeks of the receipt of any contribution.  This follow up request is placed
      conspicuously in a thank you letter and there is no request for additional contributions.  The
      contributor is clearly informed of the requirements of federal law for the reporting
      of such information and a return addressed envelope is enclosed to facilitate
      the return receipt of this information.  United Seniors PAC contributors are
      generally retired senior citizens.  If a contributor states that he/she is retired
  - value: ' we report that information in place of the name of employer and occupation
      and provide it to the FEC as required.  In fact'
  - value: ' we were able to report this information for over 60% of the itemized
      receipts on this May 2002 report.   If occupation and employer information is
      obtained in subsequent requests'
  - value: ' we provide the information to the FEC.  Please let us know if you have
      any further questions regarding this matter.'
  expected_count: 4
  input: TEXT,F3XN,,"We are in receipt of your letter regarding our May 2002 monthly
    report pertaining to United Seniors PAC's 'best efforts' to obtain information
    on each contributor according to FEC requirements.  United Seniors PAC requests
    employer and occupation information from each potential contributor in all of
    its fundraising appeals.  We then make an additional attempt to obtain the information
    within two weeks of the receipt of any contribution.  This follow up request is
    placed conspicuously in a thank you letter and there is no request for additional
    contributions.  The contributor is clearly informed of the requirements of federal
    law for the reporting of such information and a return addressed envelope is enclosed
    to facilitate the return receipt of this information.  United Seniors PAC contributors
    are generally retired senior citizens.  If a contributor states that he/she is
    retired, we report that information in place of the name of employer and occupation
    and provide it to the FEC as required.  In fact, we were able to report this information
    for over 60% of the itemized receipts on this May 2002 report.   If occupation
    and employer information is obtained in subsequent requests, we provide the information
    to the FEC.  Please let us know if you have any further questions regarding this
    matter."
